sys_variable_value.value:
(function execute(inputs, outputs) {
    var gcc = new GoogleCloudComputeUtils();
    inputs = gcc.validateInputVariables(inputs, outputs);
    gcc.validateMandatoryVariables(inputs, ['projectid', 'zone', 'name']);
    outputs = gcc.maptoOutputFromInput(inputs, outputs, ['projectid', 'zone']);
    outputs.requestbody = {
    'name':inputs.name,
    'sizeGb':inputs.sizeGb,
    'type': inputs.type
    };
})(inputs, outputs);

